import React, { Fragment } from 'react';

import MainNavigation from './MainNavigation';

const Layout = (props) => {
  return (
    <Fragment>
      <MainNavigation />
      <main>{props.children}</main>
      <hr />
      <div className='container'>
        <p>Sharing files</p>
      </div>
    </Fragment>
  );
};

export default Layout;
